import React from "react";
import "./style.css";
import NA from "../../images/north_america.png";

function NorthAmerica (props) {

  return (
    <div className="mapWrapper-north-america">
    <div className="image-container-north-america">
      <img className="northAmerica" src={NA} alt="north america map"/>
      <div>
        <span className="dot unitedStates-dot"  
            onClick={props.handleInputClick}
            className="dot northAmerica-dot"
            data-search="north america"
          ></span>
        <span className="dot canada-dot" ></span>
        <span className="dot puertoRico-dot" ></span>
        <span className="dot mexico-dot" ></span>

      </div>
    </div>
    </div>

  );
}

export default NorthAmerica;
